var iJava = "data:image/svg+xml;utf8;base64,";
var iCss3 = "data:image/svg+xml;utf8;base64,";
var iHtml5 = "data:image/svg+xml;utf8;base64,";
var iJs = "data:image/svg+xml;utf8;base64,";
var iBootstrap = "data:image/svg+xml;utf8;base64,";
var iJquery = "data:image/svg+xml;utf8;base64,";



$(function() {
    if ($("img").hasClass('i-java')) $(".i-java").prop('src', iJava);
    if ($("img").hasClass('i-css3')) $(".i-css3").prop('src', iCss3);
    if ($("img").hasClass('i-html5')) $(".i-html5").prop('src', iHtml5);
    if ($("img").hasClass('i-js')) $(".i-js").prop('src', iJs);
    if ($("img").hasClass('i-bootstrap')) $(".i-bootstrap").prop('src', iBootstrap);
    if ($("img").hasClass('i-jquery')) $(".i-jquery").prop('src', iJquery);
});